(function() {

    'use strict';

    angular
        .module('coinex-app.use-cases.reporte-maestro')
        .controller('reporteMaestroController', reporteMaestroController)

    function reporteMaestroController($scope, $state, $mdToast,  
                                     confirmModal) {   
       
        angular.extend($scope, {
            pdfGenerarCursoConsejero:pdfGenerarCursoConsejero,
            tabConsejeros:tabConsejeros,
            toggleLimitOptions:toggleLimitOptions,
            getTypes:getTypes,
            loadStuff:loadStuff,
            logItem:logItem,
            logOrder:logOrder,
            logPagination:logPagination
        });

        function init() {
          
          var tokens = localStorage.getItem('token');
          
          $scope.imagenUrl = localStorage.getItem('imagenUrl');

          if (tokens === null) {
            $state.go('app.login').then(mostrarMensajeLoguee);
          } 

        }

        function tabConsejeros(){
          var data = {	
            token:	     localStorage.getItem('token'),
            cod_anio:	   localStorage.getItem('cod_anio')
          }; 
    
          axios.post(localStorage.getItem("apiUrl") +'tabla/getCursosConsejero', data)
          .then(function (response) {
            // handle success
            $scope.cursos = response.data.cursos;
            $scope.cursos.count = $scope.cursos.length;
          })
          .catch(function (error) {
            //peticionFailed();
          })

        }
        
       
        function peticionFailed(){
          mensajeToast('No se pudo completar su peticion HTTP');
        }   

        function mensajeToast(mensaje){
          var toastInstance = $mdToast.simple()
                .textContent(mensaje)
                .position('top-right')
                .hideDelay(6000);

          $mdToast.show(toastInstance);
        }
        
        init();
        tabConsejeros();

       
       



    function pdfGenerarCursoConsejero(cursos){
      console.log(cursos);
      var doc = new jsPDF();

    
    var header = 'data:image/jpeg;base64,';
    
    doc.addImage(header, 'JPEG', 20,6,24, 24)
    
    doc.setFontSize(10);
    
    doc.setFontSize(9)
    doc.text(90, 15, 'MINISTERIO DE EDUCACIN')
    doc.text(78, 20, 'INSTITUTO POLITCNICO BILINGE GOSN');
    doc.text(97, 25, 'LISTA DE CURSOS');
    
    doc.text(20, 40, 'Consejero:');
    doc.text(20, 45, 'Ao:');

    doc.text(36, 40, localStorage.getItem('nombre'));
    doc.text(27, 45, localStorage.getItem('anio'));
    
    

    doc.setFontSize(9)

    
    doc.rect(15, 55, 165, 5)
    
    doc.setFontSize(8)
  
    doc.text(86, 59, 'CURSOS');
    
    var linea = 60;
    var i;
    
    for (i = 0; i <= cursos.length - 1; i++) { 
      

        doc.rect(15, linea, 165, 5)

        doc.setFontSize(8)

        var curso = cursos[i].curso + ' - ' + cursos[i].seccion;

        doc.text(18, linea + 4, curso);

        linea = linea + 5;

      //  doc.text(16, linea + 4, $scope.resul.notas[i].materia);
        
      //  doc.text(99, linea + 4, String(nota1));
      //  doc.text(106, linea + 4, String(nota2));
     
    } 

    doc.setFontSize(11)
    
    var string = doc.output('datauristring');
    var iframe = "<iframe width='100%' height='100%' src='" + string + "'></iframe>"
    var x = window.open();
    x.document.open();
    x.document.write(iframe);
    x.document.close();

  }


  
        function toggleLimitOptions() {
            $scope.limitOptions = $scope.limitOptions ? undefined : [5, 10, 15];
        };
          
          function getTypes() {
            return ['Candy', 'Ice cream', 'Other', 'Pastry'];
          };
          
          function loadStuff() {
            $scope.promise = $timeout(function () {
              // loading
            }, 2000);
          }
          
          function logItem(item) {
            console.log(item.cod, 'was selected');
          };
          
          function logOrder(order) {
            console.log('order: ', order);
          };
          
          function logPagination(page, limit) {
            console.log('page: ', page);
            console.log('limit: ', limit);
          }

          $scope.selected = [];
            $scope.limitOptions = [5, 10, 15];
              
              $scope.options = {
                rowSelection: true,
                multiSelect: true,
                autoSelect: true,
                decapitate: false,
                largeEditDialog: true,
                boundaryLinks: true,
                limitSelect: true,
                pageSelect: true
              };
              
              $scope.query = {
                order: 'name',
                limit: 5,
                page: 1
              };
    }

})();
